import { Card } from "react-bootstrap";
import propTypes from 'prop-types';

function Note({noteItem}) {
  return (
      <Card>
        <Card.Body>
          <Card.Text>{noteItem.name}</Card.Text>
        </Card.Body>
      </Card>
  )
};

Note.propTypes = {
  noteItem: propTypes.shape({
    name: propTypes.string.isRequired,
  }).isRequired,
}

export default Note;
